sys_variable_value.value:
(function execute(inputs, outputs) {
// ... code ...
  var auto = inputs.auto;
  var aht = inputs.aht;
  var salary = inputs.salary;
  var whours = inputs.whours;
  var wyear = inputs.wyear;
  var actCount = inputs.actCount;

  var manAct = actCount * auto;
  var savedManAct = manAct * aht;
  var savedPotAct = aht * salary / (wyear * whours * 60);
  var estSaved = manAct * savedPotAct;



  outputs.saved_manual_activities = manAct;
  outputs.saved_manual_time = savedManAct;
  outputs.savings_potential_per_activity = savedPotAct;
  outputs.saved_manual_cost = estSaved;




})(inputs, outputs);

